int drawDiamond(int size, char character) {
	int i, j, wsize = (size - (size % 2)) / (size / 2);
	int half = size / 2;

	cout << setw(wsize);

    // First half

    for (i = 1; i <= half + 1; i++) {
        for (j = 1; j <= half + 1 - i; j++) {
            cout << setw(wsize) << character;
        }

        for (j = 1; j <= 2 * i - 1; j++) {
            if (j == 1 || j == 2 * i - 1)
                cout << setw(wsize) << character;
            else
                cout << setw(wsize) << ' ';
        }

        for (j = 1; j <= half + 1 - i; j++) {
            cout << setw(wsize) << character;
        }

        cout << endl;
    }

    // Second half

    for (i = half; i >= 1; i--) {
        for (j = 1; j <= half + 1 - i; j++) {
            cout << setw(wsize) << character;
        }

        for (j = 1; j <= 2 * i - 1; j++) {
            if (j == 1 || j == 2 * i - 1)
                cout << setw(wsize) << character;
            else
                cout << setw(wsize) << ' ';
        }

        for (j = 1; j <= half + 1 - i; j++) {
            cout << setw(wsize) << character;
        }

        cout << endl;
    }

    return 0; // Return a uint to the OS
}

